INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(1, 1, 'tl_article', 128, 1389538662, 'text', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:15:\"About this demo\";}', '<p>Welcome to the official demo website of the open source content managment system Contao. On its pages you will find demonstrations and examples of some of the features this CMS has to offer. The official Contao demo comes with every installation of the CMS and is designed to help you get started with your first web projects.</p>\n<p>Like any other content management system Contao is divided into two areas: the back end (administration area) and the front end (website). If you are reading this you are currently viewing the front end. To log in to the back end, simply add <em>/contao</em> to the URL of the site ({{env::path}}contao).</p>\n<p>This demo contains a scenario demonstrating the different users - admins and editors - and their specific roles and rights within the CMS. Contao covers a lot of different scenarios: from a simple website managed by a single administrator to a community website with a lot of members participating as front end users. Complex company websites as intranet or internet solutions with a lot of back end users can be realized as well.</p>\n<p>The scenario includes three back end users (employees) and two front end users (students). Each of those users has been assigned a different role. You are able log in to their accounts and see how Contao looks like from their perspective. Please note that employees with the back end user role can only log in to the back end and students as front end users can only log in to the front end.</p>', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', '', 0, '', '', '', '', '');
INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(2, 2, 'tl_article', 512, 1360422578, 'text', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:14:\"Ways to search\";}', '<h3>1. Keyword search</h3>\n<p>This might be the default way to use a search engine. Simply enter one or more keywords and the search engine will return all pages that contain either all keywords (AND query) or at least one keyword (OR query). You can predefine the query type in the module configuration or you can change it dynamically by adding a checkbox named \"query_type\" to the search form.</p>\n<h3>2. Wildcard search</h3>\n<p>By default, the search engine searches for exact keywords only. This means that a search for <em>music</em> will not return pages containing the words <em>musical</em> or <em>musician</em>. However, if you want to search for all words that begin with music, you can add an asterisk (*) after the keyword (<em>music*</em> instead of <em>music</em>). Of course, you can also put the wildcard in front of a keyword.</p>\n<h3>3. Phrase search</h3>\n<p>Sometimes you only need results that include an exact phrase. E.g. searching for <em>music academy</em> would also return the page of a sports academy announcing an event with music and buffet. To narrow your results, simply put quotation marks around your search term (<em>\"music academy\"</em> instead of <em>music academy</em>) and the search engine will only return pages that contain the exact phrase.</p>\n<h3>4. Forcing a keyword</h3>\n<p>This feature is particularly useful when you are searching for multiple keyword (OR query) but still want ensure that a page contains a certain keyword. To force a keyword, put a plus (+) in front of it (without space). E.g. if you want to know about college fees or university fees, you are basically looking for pages that contain either the word <em>college</em> or <em>university</em> and the word <em>fees</em>. Therefor your search term should be <em>school college +fees</em>.</p>\n<h3>5. Excluding a keyword</h3>\n<p>To exclude a keyword, put a minus (-) in front of it. Thus, pages containing this keyword will not be returned. E.g. if you want to learn everything about Music Academy that has nothing to do with its campus or its courses, you should search for <em>\"music academy\" -campus -courses</em>.</p>', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', '', 0, '', '', '', '', '');
