INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(15, 11, '', 128, 1195926441, 'text', 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:33:\"We have received your term paper!\";}', 'Of course, nothing happens with the submitted data in our tutorial. However, if this was a real world website, you should do one of the following:<br />\r\n<br />\r\n1. Download or program a front end module that handles the form data and include it on this page.<br />\r\n<br />\r\n2. Edit the form header (using module \"form generator\") and choose to send the form data via e-mail. Enter a working e-mail address and a subject and save the form. Then go back to the front end page and submit the form again. You should now receive the form data via e-mail.<br />\r\n<br />\r\n{{link::back}}<br />\r\n<br />\r\nBy the way, the \"Go back\" link above is not a static link (of course) but a dynamic one. It was created using an \"insert tag\" called <em>link::back</em>. There are a few insert tags in Contao that help you include dynamic data.<br />\r\n<br />\r\n<a href=\"http://www.contao.org/en/insert-tags.html\" target=\"_blank\" title=\"Learn more about insert tags\">Learn more about insert tags</a><br />', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', '', 0, '', '', '', '', '');
INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(16, 82, 'tl_article', 128, 1447622853, 'text', 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:47:\"Welcome {{user::firstname}} {{user::lastname}}!\";}', '<p>To address a front end user by his name, we are using insert tags again (you might have come across them submitting a term paper). Insert tags are special tags which allow you to include dynamic data (e.g. the current date, the current user name or the current referer). Insert tags are replaced just before a page is printed to the screen, so they will always show the correct information even if the page is cached.<br> <br> <a title=\"Learn more about insert tags\" href=\"https://docs.contao.org/books/manual/3.5/en/04-managing-content/insert-tags.html\" target=\"_blank\">Learn more about insert tags</a><br> <br> Below this paragraph you can see the \"personal data\" module in action. This module allows front end users to change their personal data. Make sure to cross-check all changes in the back end.</p>', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', '', 0, '', '', '', '', '');
