', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:8:\"headline\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default');
