INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(186, 68, 'tl_article', 256, 1389540065, 'text', 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p>The content slider does exactly, what its name says. Similar to the <a title=\"{{link_title::52}}\" href=\"{{link_url::52}}\">accordion</a> the slider needs a wrapper start and stop. All elements placed between these wrapper elements represent the slided content.</p>\n<p>The wrapper start element offers you some parameters to modify the slider:</p>\n<ol>\n<li>Sliding interval: the time in milliseconds a slide is displayed until it is replaced by the next<br> one (1000 = 1s)</li>\n<li>Transition speed: the speed of the transition from slide to slide in milliseconds (1000 = 1s)</li>\n<li>Slide offset: setting a specific slide as the starting point, the counting starts at 0</li>\n<li>Continous:[nbsp]Make the slider start all over when reaching the end</li>\n</ol>\n<p>You can see the slider in action on the[nbsp]<a title=\"{{link_title::2}}\" href=\"{{link_url::2}}\">homepage</a>.</p>\n<p>To use it, jQuery or Mootools need to be enabled in the page layout and the corresponding j- or moo-template has to be added as well.</p>', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default');
