INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES(218, 69, 'tl_article', 384, 1389540661, 'text', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:9:\"Hyperlink\";}', '<p>You can add links within the rich text editor in the text element. To define special links, with a specific layout or with an image acting as the link, you use the hyperlink element.</p>\n<p>The following fields should always be addressed:</p>\n<ol>\n<li>Link target: the destination of the link, it can be an external URL such as https://contao.org or an internal link you can chose from the Contao site structure</li>\n<li>Open in new window: force the link to be opend in a new browser window or tab</li>\n<li>Link text: the word or phrase that will be displayed and act as the link</li>\n<li>Embed the link: a phrase to embed the link in the page by using \"%p\" as the wildcard</li>\n<li>Link title: the title attribute of the a-tag</li>\n<li>6. Lightbox: forces the browser to open the link inside a lightbox. For this field to be available Mootools or jQuery has to be enabled in the page layout and a corresponding j- or moo-template has to be added</li>\n</ol>\n<p>You can even use an image link by activating the checkbox \"create an image link\". Choose an image in the file manager, enter alternate text to be displayed when the image can not be displayed, enter an image title to be displayed with the image, set the title dimensions of the image and an optional caption.</p>', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', '1', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:9:\"hyperlink\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default');
