e option to show the image in full resolution, when the visitor clicks on the image Some media can also be grouped in a gallery.</li>\n</ol>', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, 0, 0, '', '', '', '', '', NULL, NULL, 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default');
