INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`, `description`, `robots`, `pageTitle`) VALUES(1, 3, 32, 1401260984, 'Do your users have any questions?', 'are-there-exams-how-do-they-work', 1, '<p>To display the FAQ on your website you can choose from three modules in the Contao back-end. Those offer the possibility to configure the output of your frequently asked questions in various ways.</p>\n<ul>\n<li>FAQ - List</li>\n<li>FAQ - Reader</li>\n<li>FAQ - Page</li>\n</ul>\n<p>The FAQ - List is a frontend module that lets you[nbsp]list your questions and answers from chosen categories. Only the title question and a link to the FAQ - Reader (which needs to be placed on a secondary site) are[nbsp]displayed. It might be a good option to choose this ouput if you have a longer list of questions.</p>\n<p>Another way to display information to the visitors is the FAQ - Page module. This module lists all your questions and answers on one page. Linking to another site is not necessary and therefore it is recommanded if you want to show just a few questions and keep all the information on one site. With a little additional code in the mod_faqpage.html5 template you can easily integrate a[nbsp]javascript[nbsp]accordion which will improve the usability of your FAQ greatly for your visitors.</p>', '', '', 0x00000000000000000000000000000000, '', '', '', '', '', '', '', '', '', NULL, '', '1', NULL, '', '');
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`, `description`, `robots`, `pageTitle`) VALUES(2, 3, 256, 1400845554, 'You want to hear the opinions of the website members?', 'can-i-participate-in-courses-on-a-mobile-device', 1, '<p>The FAQ also enable you to manage comments. With the tick on the checkbox \"Enable comments\"in your FAQ category configuration you allow your visitors to leave comments on your FAQs. Different options are integrated to fit your needs regarding the workflow of submitted comments.</p>\n<ul>\n<li>Moderate comments</li>\n<li>Get notified when a comment is posted (you can notify the System administrator, the author of the FAQ or both)</li>\n<li>Set the ordering and the \"Comments per page\", which automatically creates a pagination</li>\n<li>Allow your visitors to use BBCode within the comment field</li>\n</ul>', '', '', 0x00000000000000000000000000000000, '', '', '', '', '', '', '', '', '', NULL, '', '1', NULL, '', '');
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`, `description`, `robots`, `pageTitle`) VALUES(4, 3, 64, 1400845518, 'You have to answer the same over and over?', 'can-i-join-a-course-after-it-has-started', 1, '<p>Every single question and answer allows you to display a title question and a text (of course). You can also add an image and/or an enclosure next to your FAQ item. The predefined fields allow you to set an author of the item and lets you choose if you want to publish the item right away or keep it unpublished for the time being.</p>', '', '', 0x00000000000000000000000000000000, '', '', '', '', '', '', '', '', '', NULL, '', '1', NULL, '', '');
