INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `pageTitle`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `robots`) VALUES(3, 1, 1400846878, 'New Contao Community Members each day', 'new-contao-community-members-each-day', 3, 1398410100, 1398410100, '', NULL, 'The community is growing steadily', '<p>More and more web developers join the Contao community each day. Therefore Contao is able to evolve contantly.</p>', '', '', NULL, '', '', '', '', '', '', '', '', '', '', 'default', 13, 0, '', '', '', '', '', '1', '', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `pageTitle`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `robots`) VALUES(7, 1, 1401092611, 'New Contao Versions in short intervalls', 'new-contao-versions-in-short-intervalls', 1, 1400846460, 1400846460, '', NULL, 'New versions of Contao are released frequently', '<p>The Contao community works hard to continuously improve Contao. Therefore several updates are released each year. The last release was Contao 3.3.</p>', '', '', NULL, '', '', '', '', '', '', '', '', '', '', 'default', 13, 0, '', '', '', '', '', '1', '', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `pageTitle`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `robots`) VALUES(8, 1, 1401092626, 'Contao is popular', 'contao-is-popular', 2, 1392643620, 1392643620, '', NULL, 'Contao ranked in the Top5 among popular CMS\'s', '<p>In a recent security level comparison[nbsp]Contao excelled as one of the most secure Open Source CMS\'s.</p>', '', '', NULL, '', '', '', '', '', '', '', '', '', '', 'default', 13, 0, '', '', '', '', '', '1', '', '', '');
INSERT INTO `tl_newsletter` (`id`, `pid`, `tstamp`, `subject`, `alias`, `content`, `text`, `addFile`, `files`, `template`, `sendText`, `externalImages`, `sender`, `senderName`, `sent`, `date`, `mailerTransport`) VALUES(2, 3, 1400844354, 'The right newsletter for everyone', 'ma2-benefit-concert', '<p><b>The right newsletter for everyone</b></p>\n<p>The newsletter functionalities of Contao allows you to create different \"Channels\". So it\'s possible to adress visitors or regular users of your site with their specific interests. Before you send a newsletter to a list of subscribers you can make the use of the option to send a preview. Better check your newsletters on all mail clients. Some of you might know that a lot of mail servers just allow a certain amount of Emails sent within a time-amount: The \"Mails per cycle\" function will help here with larger lists.<b><br><br></b>SATURDAY<br>December 24<sup>th</sup>, 2013<br>7:30 pm</p>\n<p>SUNDAY<br>December 26<sup>th</sup>, 2013<br>3:00 pm</p>\n<p><b>Tickets $20[nbsp]to[nbsp]$40</b></p>\n<p>Call (416) 872-4255</p>', 'TEXT Content', '', 0x613a313a7b693a303b4e3b7d, 'mail_default', '', '', '', '', '1', '1360273849', '');
INSERT INTO `tl_newsletter` (`id`, `pid`, `tstamp`, `subject`, `alias`, `content`, `text`, `addFile`, `files`, `template`, `sendText`, `externalImages`, `sender`, `senderName`, `sent`, `date`, `mailerTransport`) VALUES(3, 3, 1400844298, 'Keeping everyone up to date', 'music-academy-christmals-concert', '<p><b>Keeping everyone up to date</b></p>\n<p>Contao has a built in Newsletter administration system. It offers some features to create newsletters on a regular basis. Your are able to set up an HTML template, create your newsletters just as plain text or use both functionalities. Even attachments or external images can optionally be integrated.<b><br><br></b>SATURDAY<br>December 24<sup>th</sup>, 2013<br>7:30 pm</p>\n<p>SUNDAY<br>December 26<sup>th</sup>, 2013<br>3:00 pm</p>\n<p><b>Tickets $20[nbsp]to[nbsp]$40</b></p>\n<p>Call (416) 872-4255</p>', '', '', 0x613a313a7b693a303b4e3b7d, 'mail_default', '', '', '', '', '1', '1360274551', '');
